document.addEventListener('DOMContentLoaded', () => {
  const infoBox = document.getElementById('info-box'),
        gd      = document.querySelector('#plot-container .plotly'),
        grp     = crosstalk.group('counties');
  let initialState=null, timer;

  // capture initial camera + axes
  gd.on('plotly_afterplot', () => {
    if (!initialState && gd.layout.scene) {
      initialState = {
        cam: gd.layout.scene.camera,
        xr:  gd.layout.scene.xaxis.range,
        yr:  gd.layout.scene.yaxis.range,
        zr:  gd.layout.scene.zaxis.range
      };
      infoBox.style.display='none';
    }
  });
  function restore() {
    if (!initialState) return;
    Plotly.relayout(gd, {
      'scene.camera':      initialState.cam,
      'scene.xaxis.range': initialState.xr,
      'scene.yaxis.range': initialState.yr,
      'scene.zaxis.range': initialState.zr
    });
  }

  // reset
  window.resetSelect = () => {
    const sel = document.querySelector('#countyFilter select');
    if (sel) {
      if (sel.selectize) sel.selectize.clear();
      else sel.value='';
      sel.dispatchEvent(new Event('change',{bubbles:true}));
    }
    clearTimeout(timer);
    infoBox.style.display='none';
    infoBox.style.opacity=0;
    infoBox.style.maxHeight=0;
    grp.clear();
    restore();
    return false;
  };
  document.getElementById('resetView').onclick = resetSelect;

  // show info
  function showInfo(lbl) {
    const v = lookup[lbl];
    if (!v) return;
    infoBox.innerHTML = `<strong>${lbl}</strong>
      <ul style='margin:4px 0 0 16px;'>
        <li>Poverty rate     : ${v.poverty_rate}</li>
        <li>Owner-occupancy  : ${v.owner_rate}</li>
        <li>School index     : ${v.school_index}</li>
        <li>Clustering score : ${v.clustering_county}</li>
        <li>Pred τ̂ (USD)    : ${v.predicted_tau}</li>
        <li>Cluster          : ${v.cluster}</li>
      </ul>`;
    infoBox.style.display='block';
    setTimeout(()=>{
      infoBox.style.maxHeight='500px';
      infoBox.style.opacity='1';
    },10);
    restore();
  }

  // hover → 3s
  gd.on('plotly_hover', e => {
    clearTimeout(timer);
    infoBox.style.display='none';
    if (e.points?.length===1) {
      const lbl = e.points[0].text;
      timer = setTimeout(()=>showInfo(lbl),3000);
    }
  });
  gd.on('plotly_unhover', ()=>clearTimeout(timer));

  // search select → 3s
  grp.on('selection', keys => {
    clearTimeout(timer);
    infoBox.style.display='none';
    if (keys?.length===1) {
      timer = setTimeout(()=>showInfo(keys[0]),3000);
    }
  });
});
</script>
